import React from "react";
import styled from "styled-components";
import Link from "next/link";

const NavStyle = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Nav = () => {
  return (
    <NavStyle>
      <p>Car Trader</p>
      <div>
        <Link href='/'>
          <a>Home</a>
        </Link>
        <Link href='/faq'>
          <a>Faq</a>
        </Link>
      </div>
    </NavStyle>
  );
};

export default Nav;
